import React, { useState } from 'react';
import './styles.css';
import Spreadsheet from './components/Spreadsheet.js';
import InputForm from './components/InputForm.js';
import axios from 'axios';

import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import EditableTable from './components/EditableTable';
import GraphsPage from './components/GraphsPage';

const App = () => {
  const initialData = [[null, null, null, null, null, null, null, null, null, null]];
  const columns = [
    'Pitcher Name',
    'Pitch Type', 
    'Hand', 
    'Velocity', 
    'Ind. Vert Break', 
    'Horz Break', 
    'Spin Rate', 
    'RelHeight', 
    'Extension', 
    'Vert App Angle'
  ];
  const pitchTypes = [
    '4S Fastball',
    '2S Fastball',
    'SI Fastball',
    'CT Fastball',
    'Cutter',
    'Gyro Slider',
    'Slider',
    'Slutter',
    'Sweeper',
    'Slurve',
    '12/6',
    'Traditional CH',
    'Sidespin SH',
    'Splitter'
  ];
  const handTypes = ['RH', 'LH'];

  return (
    <div>
        <h1>Baseball Pitch Grader</h1>
        <Router>
            <Switch>
                <Route 
                    exact path="/" 
                    render={(props) => <EditableTable {...props} data={initialData} columns={columns} options={[pitchTypes, handTypes]} />}
                />
                <Route path="/graphs" component={GraphsPage} />
            </Switch>
        </Router>
    </div>
  );
};

export default App;
